// Fast case: bit is much higher than all existing words
if(this.length<=s){
this._expand(s+1);
this.words[s]|=q;
return this;
}

// Add bit and propagate, if needed
var carry=q;
for(var i=s;carry!==0&&i<this.length;i++){
var w=this.words[i]|0;
w+=carry;
carry=w>>>26;
w&=0x3ffffff;
this.words[i]=w;
}
if(carry!==0){
this.words[i]=carry;
this.length++;
}
