this.strip();

var res;
if(this.length>1){
res=1;
}else{
if(negative){
num=-num;
}

assert(num<=0x3ffffff,'Number is too big');

var w=this.words[0]|0;
res=w===num?0:w<num?-1:1;
}
if(this.negative!==0)return-res|0;
